// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

error CallFailed();

contract Caller {
    // call()傳送ETH
    function call(address _to, uint a, uint b) external {
        (bool success, bytes memory data) = _to.call(abi.encodeWithSignature("sum(uint,uint)", a, b));
        if(!success){
            revert CallFailed();
        }
    }
}

